import Vue from 'vue'
import VuRouter from 'vue-router'
import Home from '../views/Home/index.vue'
import viewUser from '../views/User/index.vue'

Vue.use(VuRouter)

const routes =[
    {
        path:'/',
        name:'Login',
        component:Home,
    },
    {
        path:'/home',
        name:'Home',
        component:Home,
        children:[

        ]
    },
    {
        path:'/user',
        name:'User',
        component:viewUser
    }
]

const router = new VuRouter({
    mode:'history',
    routes
})

export default router
